import * as React from 'react';
import wrapIcon from '../utils/wrapIcon';
const rawSvg = (iconProps) => {
    const { className, primaryFill } = iconProps;
    return React.createElement("svg", { width: 16, height: 16, viewBox: "0 0 16 16", xmlns: "http://www.w3.org/2000/svg", className: className },
        React.createElement("path", { d: "M1.46 2.44c.03-.8.7-1.44 1.5-1.44h1.08c.8 0 1.47.64 1.5 1.44l.42 11A1.5 1.5 0 014.46 15H2.54a1.5 1.5 0 01-1.5-1.56l.42-11zm5 12.56c.33-.44.52-1 .5-1.6L6.7 6.82l3.48-2.71a.5.5 0 01.81.39v2.4l3.17-2.78a.5.5 0 01.83.38v9c0 .83-.67 1.5-1.5 1.5H6.46zM13 14v-3.5a.5.5 0 00-.5-.5h-3a.5.5 0 00-.5.5V14h4z", fill: primaryFill }));
};
const BuildingFactory16Filled = wrapIcon(rawSvg({}), 'BuildingFactory16Filled');
export default BuildingFactory16Filled;
